 -13.

Note:
The length of the input array is between [1, 10,000].
Elements in the given array will be in range [-1,000, 1,000].

class Solution {
public:
    int calPoints(vector<string>& ops) {
        int sum = 0;
        vector<int> scores;
        for (string op : ops) {
            if (op == "C") {
                sum -= scores.back();
                scores.pop_back();
            } else if (op == "D") {
                scores.push_back(scores.back() * 2);
                sum += scores.back();
            } else if (op == "+") {
                scores.push_back(scores[scores.size() - 2] + scores.back());
                sum += scores.back();
            } else {
                scores.push_back(stoi(op));
                sum += scores.back();
            }
        }
        return sum;
    }
};
